    false,nt"url": null,nt"notes": "Most of the Aleutian Islands support populations
    of rock ptarmigan (Lagopus mutus), where their abundance is believed to be greatly
    influenced by the abundance of arctic fox (Alopex lagopus). The ptarmigan census
    on Adak was developed to provide information on ptarmigan density which can be used
    in comparison with other populations. The original proposal included a census on
    Attu Island, but this was not done due to personnel and budget constraints. This
    study will provide basic background and long term trend data necessary for making
    recommendations regarding ptarmigan management in the Aleutians.",nt"owner_org":
